import React from "react";
import User from "./User";
import { useQuery, gql } from "@apollo/client";

const USER_QUERY = gql`
  {
    users {
      id
      name
      username
      picture
      email
      links
    }
  }
`;

const LinkList = () => {
  const { data } = useQuery(USER_QUERY);

  return (
    <div>
      {data && (
        <>
          {data.map((user) => (
            <div>
              <div>{user.id}</div>
              <div>{user.username}</div>
            </div>
          ))}
        </>
      )}
    </div>
  );
};

export default LinkList;
